import React, { useState} from 'react';
import AddBookForm from './AddBookForm';
import BookList from './BookList';

function App() {

  const [books] = useState([ 
    "book1",
    "book2",
    ""
  ]);

  return (
    <>
    <h1 id="title">Favorite Books</h1>
    <AddBookForm/>
    <BookList books={books}/>
    </>
  );
}

export default App;
